import React, { Component } from 'react';
import { BrowserRouter, Route, Routes, Redirect } from 'react-router-dom';
import Login from './Login';

const Router = () => {
    return (
        <Routes>
            <Route exact path="/" element={<Login />}/>
        </Routes>
    );
}

export default Router;
